Actionscript.script:
function 转帧()
{
   _parent.动画是否正在播放 = false;
   if(_parent.动画 != undefined)
   {
      gotoAndPlay(_parent.动画);
   }
   else
   {
      gotoAndPlay(1);
   }
}
_parent.动画 = "普通站立-" + _parent.性别;
转帧();

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
